import React from "react";
import Jumbotron from "./jumbotron";

function Footer(){
    var d=new Date();
    var year=d.getFullYear;
    return(
        <Jumbotron>
            <footer>&copy; Copyright {d} @StreamingService.com</footer>
        </Jumbotron>
    );
}
export default Footer;
